import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';

import { SharedModule } from 'app/shared/shared.module';
import { LOGIN_ROUTE } from './login.route';
import { LoginComponent } from './login.component';

import { NgIdleModule } from '@ng-idle/core';
import { UserIdleDialogComponent } from './user-idle-dialog.component';
import { TimeOutDialogComponent } from './time-out-dialog.component';
import { UserIdleService } from './user-idle.service';
import { UserForceLoginDialogComponent } from './user-forcelogin-dialog.component';

@NgModule({
  imports: [SharedModule, NgIdleModule.forRoot(), RouterModule.forChild([LOGIN_ROUTE])],
  declarations: [LoginComponent, UserIdleDialogComponent, TimeOutDialogComponent, UserForceLoginDialogComponent],
  entryComponents: [UserIdleDialogComponent, TimeOutDialogComponent, UserForceLoginDialogComponent],
  providers: [UserIdleService],
})
export class LoginModule {}
